    constructor(props) {
        super(props);
        this.state = {
            'username': "none"
        }
    }

    componentDidMount() {
        document.title = "Creator dashboard"
        fetch("/profile", {
        })
        .then(response => response.json())
        .then(data => {
            this.setState({
                username: data['username']
            })
        })
    }


    render() {
        return <div class="studio">
